import React from 'react';
import Navigation from './Navigation';

const Layout = ({children})=>{
    return(
        <>
            <div>
                <Navigation />
                <div>
                    {children}
                </div>
            </div>

            <style jsx>{`
            div{
                background: #BF2642;
                width: 100%;
                height: auto;
                margin: 0;
            }
        `}</style>
        </>
    )
}
export default Layout;
